import Navi from './Navi';
import CategoryList from './CategoryList';
import ProductList from './ProductList';
import{Container,Row} from 'reactstrap';

function App() {
  return (
    <div>
      <Container>
      <Row>
      <Navi /> 
      </Row>

      <Row>
<CategoryList/>
    <ProductList/>
      </Row>
      </Container>


    </div>
  );
}

export default App;
